(1, 'CSE 133', 'Structured Programming Language', 3, 1, '', NULL),
(2, 'CSE 134', 'Structured Programming Language Lab', 3, 0, '<p>\r\n    Students should be able to solve different easy problems with their analysis using pen and papers and then doing code on computers just like expressing\r\n    their speech using a language; they should also be able to calculate outputs for different inputs on papers before running the code that will prove their\r\n    understanding of the logics behind the code.\r\n</p>\r\n<p>\r\n    <strong>Introduction: </strong>\r\n    Introductory outputs using C.\r\n</p>\r\n<p>\r\n    <strong>Data Types and Operator:</strong>\r\n    Declaring variables of different data types and doing different types of operations on them, facing problems when internal result of calculation crosses\r\n    the boundary of a data type.\r\n</p>\r\n<p>\r\n    <strong>Data Input/Output:</strong>\r\n    Variation and formats of getting input and giving output.\r\n</p>\r\n<p>\r\n    <strong>Control Statement:</strong>\r\n    Implementation of all types of control statement structures, odd/even test, find max/min from 2/3 numbers, generate grades from marks, floor, ceiling,\r\n    absolute value, sum of n numbers using loop and calculate average, test prime, generate Fibonacci sequence.\r\n</p>\r\n<p>\r\n    <strong>Array, String and Nested Looping: </strong>\r\n    Finding the number of students getting marks above average, finding vowel and consonant from a given string, detecting palindrome, counting words of a\r\n    string, reversing each words of a sentence, using different functions of string.h library, bubble sort, matrix multiplication,\r\n</p>\r\n<p>\r\n    <strong>Using Library Functions:</strong>\r\n    Functions from stdio.h, math.h, stdlib.h and ctype.h library. <strong>Functions:</strong> Doing some previous problems using function, implement call by\r\n    value and call by reference, prime factorization.\r\n</p>\r\n<p>\r\n    <strong>Recursion:</strong>\r\n    Find Greatest Common Divisor, Fibonacci, Factorial, Tower of Hanoi. <strong>Program Structure:</strong> Use static and global variable.\r\n</p>\r\n<p>\r\n    <strong>Pointers:</strong>\r\n    Passing pointer to a function, dynamic memory allocation, arrays of pointers. <strong>Structure and Union:</strong> Sorting points (first according to x,\r\n    then according to y), using line segment structure (point structure inside line), using union.\r\n</p>\r\n<p>\r\n    <strong>File: </strong>\r\n    Opening, closing, creating and processing data files.\r\n</p>', NULL),
