(44, 'CSE 300', 'Project Work & Seminar', 2, 0, '<p>\r\n    Projects must possess innovative ideas which reflect contemporary IT trends. Supervisor have to ensure that every accepted project contain basic level of\r\n    research work.\r\n</p>\r\n<p>\r\n    Projects that meet the software/hardware requirements of SUST or any other IT organization are highly preferable. Students have to give a presentation on\r\n    their project works. Departments should take appropriate steps to archive all the projects and keep tracks to maintain the genuineness of the projects.\r\n</p>', NULL),
(45, 'CSE 329', 'Computer Architecture', 3, 1, '<p>\r\n    <strong>Introduction to Computer Architecture:</strong>\r\n    Overview and history; Cost factor; Performance metrics and evaluating computer designs.\r\n</p>\r\n<p>\r\n    <strong>Instruction set design:</strong>\r\n    Von Neumann machine cycle, Memory addressing, classifying instruction set architectures, RISC versus CISC, Micro programmed vs. hardwired control unit.\r\n</p>\r\n<p>\r\n    <strong>Memory System Design:</strong>\r\n    Cache memory; Basic cache structure and design; Fully associative, direct, and set associative mapping; Analyzing cache effectiveness; Replacement\r\n    policies; Writing to a cache; Multiple caches; Upgrading a cache; Main Memory; Virtual memory structure, and design; Paging; Replacement strategies.\r\n</p>\r\n<p>\r\n    <strong>Pipelining:</strong>\r\n    General considerations; Comparison of pipelined and nonpipelined computers; Instruction and arithmetic pipelines, Structural, Data and Branch hazards.\r\n</p>\r\n<p>\r\n    <strong>Multiprocessors and Multi-core Computers:</strong>\r\n    SISD, SIMD, and MIMD architectures; Centralized and distributed shared memory- architectures; Multi-core Processor architecture. Input/output Devices:\r\n    Performance measure, Types of I/O device, Buses and interface to CPU, RAID. Pipelining: Basic pipelining, Pipeline Hazards. Parallel Processing.\r\n</p>', NULL),
(46, 'CSE 331', 'Software Engineering', 3, 1, '<p>\r\n    <strong>Introduction: </strong>\r\n    Overview of Software Industry, Introduction to Software Engineering, Software Development Process and Various Life Cycle Models.\r\n</p>\r\n<p>\r\n    <strong>Requirement Analysis: </strong>\r\n    Communication Techniques, Analysis Principles, Software Prototyping, Requirement Specification.\r\n</p>\r\n<p>\r\n    <strong>Group Dynamics</strong>\r\n    : Working in Teams, Characteristics of Successful Team, Understanding Group Dynamics, Team Roles and Temperament, Democratic Team and Chief Programmer Team\r\n    Approach. <strong></strong>\r\n</p>\r\n<p>\r\n    <strong>Introduction to Extreme Programming, Analysis Modeling: </strong>\r\n    Steps of system analysis, Feasibility study, Economic and technical analysis, System specification, the elements of analysis model, Data modeling,\r\n    Functional modeling and information flow, Behavioral modeling, Mechanics of structured analysis, Data Dictionary.\r\n</p>\r\n<p>\r\n    <strong>Software Design</strong>\r\n    : Design principles, Design Concepts, effective modular design, design heuristics, Data Design, Architectural Design process, Transformation mapping,\r\n    Transaction mapping, interface design, human-computer interface design, procedural design.\r\n</p>\r\n<p>\r\n    <strong>Software Testing: </strong>\r\n    Testing fundamentals, test case design, white-box testing, black-box testing, testing GUIs, Unit testing, Integration testing, validation testing, system\r\n    testing, debugging.<strong></strong>\r\n</p>\r\n<p>\r\n    <strong>Maintenance: </strong>\r\n    Major maintenance activities, estimating maintenance cost and productivity<strong>. </strong>\r\n</p>\r\n<p>\r\n    <strong>Technical Metrics for Software: </strong>\r\n    Software quality, Framework for technical metrics, metrics for analysis and design models, source code, testing and maintenance. Software Architecture:\r\n    Pipe and Filter, Object Oriented, Event Based, Layered System, Data-centered repository, Process Control Architectures,\r\n</p>\r\n<p>\r\n    <strong>Object Oriented Software Engineering: </strong>\r\n    O-O concepts, O-O analysis, Domain analysis, O-O analysis process, Object relational model. O-O design: system design process, object design process, O-O\r\n    programming.\r\n</p>\r\n<p>\r\n    <strong>O-O Testing: </strong>\r\n    Testing strategies, test case design. <strong></strong>\r\n</p>\r\n<p>\r\n    <strong>Service Oriented Software Engineering: </strong>\r\n    Introduction to SOA, SOAP, Analysis, design, validation, verification, implementation and maintenance of service oriented software; ESB, Messaging\r\n    Architecture, Software Tools for SOA.\r\n</p>\r\n<p>\r\n    <strong>Software Project Management: </strong>\r\n    Cost estimation, risk analysis, project scheduling. Introduction to CASE Tools: What is CASE, taxonomy of CASE tools, CASE environment, CASE repository,\r\n    Example CASE tools.\r\n</p>\r\n<p>\r\n    <strong>Intellectual Properties: </strong>\r\n    Trade Marks, Copy Rights, Trade Secrets, Patents, Introduction to UML.\r\n</p>', NULL),
(47, 'CSE 332', 'Software Engineering Lab', 1.5, 0, 'Software Engineering lab works is solely designed to attain hands on experience of architectural design, documentation and testing of software so that students can develop the software following the documents only.\r\nStep1 (Requirement Engineering): Choose a company/institute/client for which software will be developed (make sure that they will provide required information whenever necessary). Follow the steps for eliciting requirements and generate use-case diagram. Also analyze the sufficiency of the requirement engineering outcome for steps to follow.\r\nStep 2 (Analysis model to Architectural and Component level design): Generate Activity diagram, Data flow diagram (DFD), Class diagram, State diagram, Sequence diagram and follow other relevant steps for creating complete architectural and component level design of the target software.\r\nStep 3 (User Interface design, Design evaluation, Testing strategies and Testing Tactics): Perform the user interface design with the help of swimlane diagram. Carry out the design evaluation steps. Generate all test cases for complete checking of the software using black box, white box testing concept.\r\nStep 4 Software testing and debugging\r\nStep 5 (Managing Software Projects): Analyze the estimation and project schedule.\r\n', NULL),
(48, 'CSE 361', 'Computer Networking', 3, 1, '<p>\r\n    <strong>Introduction:</strong>\r\n    Introduction to Computer Networks, Network Goals, Applications of Networks, Network Structure, Network Architectures, The OSI Reference Model, Data\r\n    Transmission in the OSI Model, OSI Terminology, The ARPANET.\r\n</p>\r\n<p>\r\n    <strong>Local Area Network: </strong>\r\n    LAN Technology - Architecture, Topology.\r\n</p>\r\n<p>\r\n    <strong>Wired LANs:</strong>\r\n    Ethernet and Fast-Ethernet, Token Ring, FDDI.\r\n</p>\r\n<p>\r\n    <strong>Wireless LANs:</strong>\r\n    IEEE 802.11, Bluetooth. Backbone Networks, Virtual LANs.\r\n</p>\r\n<p>\r\n    <strong>Wide Area Network:</strong>\r\n    SONET, Virtual Circuit Networks - Frame Relay, ATM and ATM LANs.\r\n</p>\r\n<p>\r\n    <strong>Network Layer: </strong>\r\n    Logical Addressing,<strong> </strong>\r\n</p>\r\n<p>\r\n    <strong>Internet Protocol: </strong>\r\n    Internetworking, Routing Protocol, IPv4 and IPv6.\r\n</p>\r\n<p>\r\n    <strong>Address Mapping, Error Reporting and Multicasting:</strong>\r\n    ICMP, IGMP, ICMv6. Delivery, Forwarding and Routing.\r\n</p>\r\n<p>\r\n    <strong>Transport Layer:</strong>\r\n    Process-to-Process delivery, Transport Services, Protocol mechanisms, TCP, UDP, SCTP, Congestion and QoS.\r\n</p>\r\n<p>\r\n    <strong>Application Layer:</strong>\r\n    Domain Name System, Abstract Syntax Notation One (ASN.1), Network Management - SNMPv2, Electronic mail - SMTP and MIME, Uniform Resource Locator (URL) and\r\n    Universal Resource Identifier (URI), Hypertext Transfer Protocol (HTTP).\r\n</p>\r\n<p>\r\n    <strong>Wireless and Mobile Networking</strong>\r\n    : Wireless Networking: Issues and Trends, Wireless Physical Layer Concepts , Wireless Cellular Networks, Mobile IP - IPv4, IPv6, TCP over Wireless, Ad Hoc\r\n    Networks: Issues and Routing, Wireless Sensor Networks, Wireless Mesh and Multi-Hop Relay Networks, Wireless Network Security, Energy Management in Ad Hoc\r\n    Wireless Networks.\r\n</p>\r\n<strong>Network Security:</strong>\r\n<p>\r\n    Security requirements and attacks, Privacy with conventional encryption, Message Authentication and Hash functions, Public-key encryption and digital\r\n    signatures, Ipv4 and Ipv6 security.\r\n</p>', NULL),
(49, 'CSE 362', 'Computer Networking Lab', 1.5, 0, '<p>\r\n    Subnetting and designing a network using Packet Tracer.\r\n</p>\r\n<p>\r\n    Analysis of the TCP/IP behavior.\r\n</p>\r\n<p>\r\n    Packet analysis.\r\n</p>\r\n<p>\r\n    Server configuration: DHCP, SMTP, FTP, Web\r\n</p>\r\n<p>\r\n    Switch and Router Configuration.\r\n</p>\r\n<p>\r\n    Socket Programming\r\n</p>', NULL),
(50, 'CSE 373', 'Computer Graphics and Image Processing', 3, 1, '<p>\r\n    <strong>Computer Graphics Programming:</strong>\r\n    OpenGL. <strong>Camera Analogy:</strong> Viewing, Windowing, Clipping. <strong>Projective Transformation(Ray-tracing):</strong> Orthogonal Projection,\r\nPerspective Projection, <strong>Vector:</strong> Normal Vector, View Vector, <strong>Matrix:</strong> 2D and 3D Rotation and Translation Matrix,<strong>Raster Graphics:</strong> Line Drawing, Anti-aliasing, Polygon Filling Algorithms, <strong>Hidden Surface Removal:</strong> z-buffering,    <strong>Lighting and Surface Property: </strong>Diffused Light, Ambient Light, Specular Light, Lighting Models for reflection, <strong>Shading:</strong>\r\n    Flat Shading, Lambert Shading, Phong Shading, <strong>Texture Mapping: </strong>Texture Fundamentals, <strong>Animation:</strong> Real time animation.\r\n</p>\r\n<p>\r\n    <strong>Image Processing</strong>\r\n    : Image Fundamentals, <strong>Image Enhancement: </strong>Background, Enhancement by Point-Processing, Spatial Filtering, Enhancement in Frequency Domain,\r\n    Color Image Processing. <strong>Image Restoration: </strong>Degradation Model, Diagonalization of Circulant and Block-Circulant Matrices, Algebraic\r\n    Approach to Restoration, Inverse Filtering, Geometric Transformation. <strong>Image Segmentation: </strong>Detection of Discontinuities, Edge Linking and\r\n    Boundary Detection, Thresholding, Region-Oriented Segmentation, The use of Motion in Segmentation. <strong>Image Compression|</strong>.\r\n</p>', NULL),
(51, 'CSE 374', 'Computer Graphics and Image Processing Lab', 1.5, 0, '<p>\r\n    Tool to use for lab: OpenGL\r\n</p>\r\n<ol start="1" type="1">\r\n    <li>\r\n        Line Drawing: Bresenhams\r\n    </li>\r\n    <li>\r\n        Region Filling: Scan Line Algorithm\r\n    </li>\r\n    <li>\r\n        Transformation: 2D and 3D translation, Rotation, Scaling\r\n    </li>\r\n    <li>\r\n        Clipping: Line and Polygon\r\n    </li>\r\n    <li>\r\n        Projection: Perspective and Parallel\r\n    </li>\r\n    <li>\r\n        Animation: Morphing\r\n    </li>\r\n</ol>', NULL),
(52, 'CSE 375', 'Technical Writing And Presentation', 2, 1, '<p>\r\n    Issues of technical writing and effective oral presentation in Computer Science and Engineering; Writing styles of definitions, propositions, theorems and\r\n    proofs; Preparation of reports, research papers, theses and books: abstract, preface, contents, bibliography and index; Writing of book reviews and referee\r\n    reports; Writing tools: LATEX; Diagram drawing software; presentation tools.\r\n</p>', NULL),
